import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <p>First React Test CASE</p>
      <p>Deepali Singh</p>
      <img
        src="https://images.pexels.com/photos/17690714/pexels-photo-17690714.jpeg"
        title="Beautiful girl in the park"
        width="500"
      />
      <img src='img.jpg' alt='alternate image'/>
    </div>
  );
}

export default App;
